post_text:
We will devote Thursday and Friday of this week to RLP Reconnect!, a set of activities that have been carefully and thoughtfully designed to reconnect staff and students with one another so that:
(1) Students and staff have opportunities to discuss current events and practice exercises that can be helpful for maintaining wellness during times of crisis;
(2) Students may return to a sense of normalcy that they may otherwise lack, which has been shown to help students cope;
(3) Students and staff may work together to refine our RLPs; and
(4) Students may have sufficient time to acclimate to high quality instructional strategies that are best suited for more extended periods of remote learning.

